import React, { Component } from 'react';

class Navbar extends Component {
  render() {
    return (
        <div class="h-40, w-10 bg-emerald-300">
            <Link to="about">About Page</Link>
            <Link to="contact">Contact Page</Link>
        </div>
    )
  }
}

export default Navbar;
